job_description:
About the job
Work authorization: any (candidate must be authorized to work in US)

Must-have Skills

5+ y of exp in MuleSoft Application Development

exp in application development, data modeling and/or data analysis

PREFERRED : gov exp.

Location: Tallahassee, FL

Rate: please send resumes of your consultants along with their minimum rate they will accept to take (and stay) on this position .

Remote or onsite: Hybrid, some onsite meetings.

Type: long-term contract

Duration: 12+ months with possible extensions

Additional information: The candidate should be able to provide an ID if the interview is requested , to guarantee the Client that the candidate submitted, interviewing and showing up for work is one and the same

Requirements

Availability to work at the Client's site in Tallahassee, FL (required);

MuleSoft application development experience (5+ years);

Experience in application development, data modeling and/or data analysis;

Experience developing scalable, simple to complex API web services using the MuleSoft platform;

Experience developing complex SQL queries and stored procedures;

Experience creating and maintaining domain diagrams, architecture frameworks, design patterns and standards to support technology strategy;

Bachelor's degree in Computer Science, Engineering or related field (preferred).

Responsibilities

Responsibilities include but are not limited to the following

Architect, design, develop and implement small to large scale integration solutions in MuleSoft platform;

Administer architecture components within MuleSoft platform;

Create architectural deliverables that clearly communicate design and solution expectations;

Understand and clarify complex business integration requirements and produce eloquent and scalable designs utilizing the MuleSoft Any point platform;

Create and maintain Domain diagrams, architecture frameworks, design patterns and standards to support technology strategy;

Plan and deliver integration architecture that is aligned with IT strategies and principles;

Work closely with other enterprise architects, security, networking, developers, and infrastructure teams to develop integration architecture suitable for implementing common services, business rules, data transformation, and data movement across systems;

Conduct design reviews, gap analysis and assessment when required;

The architecture covers the data integration, databases, and the means to receive the data. Resolve all types of design, test, and data issues;

Explain complex technical issues to project managers, developers and architects in an easy to-understand manner and recommend clearly thought-out solutions;

Work with small development teams in multi-phase heterogeneous work environments and work streams;

Deliver high-quality production-ready application services, integration programs, APIs and web services;

Develop high-quality queues and flows for Message Queue Services;

Actively test and clearly document implementations so others can easily understand the requirements, implementation, and test conditions;

Guide and work with support teams in troubleshooting production issues and provides technical support of the integration platform;

Build trust with business and IT stakeholders by implementing technical solutions for enterprise-wide systems;

Participate in the continuous improvement of the Enterprise Application Integration platform by making technical contributions and by providing architectural recommendations.
